export const INSERT_CLIENT = "INSERT.CLIENT";
export const GET_CLIENT_IDS = "GET.CLIENT.IDS";

export const createInsertClientStatusAction = res => {
    return {
        type: INSERT_CLIENT,
        result: res
    }
};
export const createGetClientIdsAction = res => {
    return {
        type: GET_CLIENT_IDS,
        result: res
    }
};
